import React from 'react';
import './tile.scss';

function Tile(props) {

    function selectTile(item, ref) {
        if(item === -1) alert("You lose!");

    }

    return (
        <div>
            {props.tile.map((item, index) => (
                <div ref={index} className="tile cover" onClick={() => selectTile(item)}>
                    {item}
                </div>
            ))}
        </div>
    )
}
export default Tile;
